import { useState } from "react";
const Creator = (props) => {




    return ( 
        <div  className='creator'>
        <div className='creator__top'>
          <input placeholder='Название задачи' className='creator__name'/>
          <input placeholder='00:00' className='creator__time'/>
        </div>
        <div className='creator__bottom'>
          <input placeholder='Описание задачи' className='creator__body'/>
        </div>
        <div className='creator__btns'>
          <button onClick={props.visChange()} className='creator__cancel'>Отмена</button>
          <button className='creator__task'>Добавить задачу</button>

        </div>

       </div>
        );
}
 
export default Creator;
